webpackJsonp([0x755cad85ddd5],{1345:function(e,s){e.exports={data:{package:{type:"published",id:"relude",name:"relude",version:"0.7.0",category:"library",flags:[],platforms:["browser","node"],description:"Alternative standard library (prelude) for ReasonML",keywords:["utilities","collections","standard library"],license:"MIT",updated:"2019-05-03T16:23:28.342Z",stars:44,score:.6175189483499117,quality:.8229876446645645,popularity:.058937587314255545,maintenance:.9999842839730084,readme:'<h1 id="relude"><a href="#relude" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Relude</h1>\n<p><a href="https://circleci.com/gh/reazen/relude"><img src="https://img.shields.io/circleci/project/github/reazen/relude/master.svg" alt="CircleCI branch"></a>\n<a href="https://www.npmjs.com/package/relude"><img src="https://img.shields.io/npm/v/relude.svg" alt="npm"></a></p>\n<p>Relude is a ReasonML/BuckleScript/OCaml standard library replacement ("prelude") written in <a href="https://reasonml.github.io/">ReasonML</a>, targeting compilation to JavaScript via the <a href="https://bucklescript.github.io/">BuckleScript</a> compiler.</p>\n<p>Relude aims to provide a robust collection of modules, types, and functions built on top of reusable typeclass-style abstractions, with a focus on day-to-day practical use. While Relude has its foundation in category theory and abstract algebra concepts, our goal is to make the library as easy-to-use as a library like <a href="https://lodash.com/docs">Lodash</a> for people who don\'t know or care about category theory. This is possible due to OCaml\'s powerful module system and the amazing work that has gone into <a href="https://github.com/Risto-Stevcev/bs-abstract">bs-abstract</a>, on which much of Relude is based.</p>\n<p>For example, the following functions all exist in Relude, and are all backed by the same underlying function (<code>fold</code> from <code>Foldable</code>, when the inner type implements <code>Monoid</code>):</p>\n\n    <div class="redex-codeblock m-tabbed">\n      <ul>\n        <li class="reason s-selected"> RE\n        <li class="ml"> ML\n      </ul>\n      <div class="codeblock reason s-selected">\n        <pre class="hljs lang-reason"><code>open <span class="hljs-type">Relude</span>.<span class="hljs-type">Globals</span>;\n\n<span class="hljs-type">List</span>.<span class="hljs-type">String</span>.<span class="hljs-built_in">join</span>([<span class="hljs-string">"hello "</span>, <span class="hljs-string">"world"</span>]); <span class="hljs-comment">// "hello world"</span>\n<span class="hljs-type">Array</span>.<span class="hljs-type">Float</span>.sum([| <span class="hljs-number">1.1</span>, <span class="hljs-number">2.2</span>, <span class="hljs-number">3.3</span> |]); <span class="hljs-comment">// 6.6</span>\n<span class="hljs-type">List</span>.fold((<span class="hljs-class"><span class="hljs-keyword">module</span> <span class="hljs-title">Int</span>.<span class="hljs-title">Multiplicative</span>.<span class="hljs-title">Monoid</span>), [2, 2, 3]); // 12</span></code></pre>\n      </div>\n      <div class="codeblock ml">\n        <pre class="hljs lang-ml"><code><span class="hljs-number">2553</span>: &lt;<span class="hljs-type">UNKNOWN</span> <span class="hljs-type">SYNTAX</span> <span class="hljs-type">ERROR</span>&gt;</code></pre>\n      </div>\n    </div>\n  \n<p>Relude is heavily inspired by <a href="https://pursuit.purescript.org/packages/purescript-prelude">PureScript\'s Prelude</a>, as well as other FP ecosystems including Scala, Haskell, and Elm. Many of the underlying functions live in either OCaml\'s stdlib or Bucklescript\'s Belt, but functionality is increasingly being replaced with custom implementations.</p>\n<h3 id="note-about-piping---vs-"><a href="#note-about-piping---vs-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Note About Piping (<code>-></code> vs <code>|></code>)</h3>\n<p>Unlike Belt, Relude prefers <strong>significant-data-last</strong> (i.e. <strong>pipe last</strong> or <strong>thread last</strong>) semantics. This means you\'ll tend to use <code>|></code> with Relude functions, instead of <code>-></code>.  In specific situations, this style can lead to slightly worse type inference, but it has the benefit of improved composability (and no dependency on compiler magic).</p>\n<h2 id="installation"><a href="#installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Installation</h2>\n<p>The library is published on <a href="https://www.npmjs.com/package/relude">npm</a>. We try to respect semantic versioning, but while Relude is at version 0.x, there will likely be major breaking changes without corresponding major version bumps.\nWe will try to document migration paths in release notes when possible.</p>\n<div class="redex-codeblock"><pre class="hljs lang-none"><code>&gt; npm install --save relude\n\n<span class="hljs-keyword">or</span> point at a git <span class="hljs-built_in">ref</span> (tag, commit has, etc.)\n\n&gt; npm install --save <span class="hljs-string">"github:reazen/relude#someref"</span></code></pre></div>\n<h2 id="documentation-possibly-out-of-date-and-subject-to-change"><a href="#documentation-possibly-out-of-date-and-subject-to-change" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Documentation (possibly out of date and subject to change)</h2>\n<ul>\n<li><a href="https://reazen.github.io/relude">API documentation</a></li>\n</ul>\n<h2 id="project-status"><a href="#project-status" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Project Status</h2>\n<p>Relude has a fairly complete test suite, and is being used in production. However, it\'s still a relatively young project and subject to breaking changes and likely has some bugs.</p>\n<p>It\'s also true that many function implementations are not optimal (e.g. <code>List.distinct</code> is currently O(n<sup>2</sup>) because it depends only on equality of its inner elements, not ordering).  We hope to improve these types of things over time.</p>\n<p>We welcome all contributions!  This includes code fixes, help with documentation, or just using the library and providing feedback about anything that is unclear or not working the way you would expect.</p>\n<h2 id="documentation-status"><a href="#documentation-status" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Documentation Status</h2>\n<p>The documentation for Relude is a work in progress, and HTML generation is currently on-hold - waiting to see what shakes out as the preferred documentation extraction/rendering tool for the ReasonML/BuckleScript community.</p>\n<p>Documentation contributions are welcome, but all documentation may be subject to change in the future.</p>\n<p>There are some in-code documentation comments, and the type signatures alone are often sufficient documentation by themselves.</p>\n<h1 id="developer-info"><a href="#developer-info" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Developer info</h1>\n<h2 id="development-scripts"><a href="#development-scripts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Development scripts</h2>\n<ul>\n<li>Clean: <code>npm run clean</code></li>\n<li>Build: <code>npm run build</code></li>\n<li>Clean &#x26; build: <code>npm run cleanbuild</code></li>\n<li>Test: <code>npm run test</code></li>\n<li>Clean &#x26; test: <code>npm run cleantest</code></li>\n<li>\n<p>Gen docs: <code>npm run docs</code></p>\n<ul>\n<li>Note: this currently uses <code>jaredly/redoc</code> but this may change. If you have any trouble running <code>npm install</code>, you may want to try removing <code>redoc</code> as a dependency</li>\n</ul>\n</li>\n<li>Start compiler watcher: <code>npm run start</code></li>\n</ul>\n<h2 id="publishing-to-npm"><a href="#publishing-to-npm" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Publishing to npm</h2>\n<p>We currently do this by hand:</p>\n<div class="redex-codeblock"><pre class="hljs lang-none"><code><span class="hljs-comment"># Bump the version, update package.json, and create the git tag</span>\n&gt; npm version major|minor|patch\n\n<span class="hljs-comment"># Push git commit and tags to upstream/origin</span>\n&gt; git push upstream\n&gt; git push upstream --tags\n&gt; git push origin\n&gt; git push origin --tags\n\n<span class="hljs-comment"># Publish the new version to npm</span>\n&gt; npm publish\n\n<span class="hljs-comment"># Go to GitHub and create a new release</span></code></pre></div>\n<h2 id="nixos"><a href="#nixos" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>NixOS</h2>\n<p>If you are using NixOS, there is an extremely basic <code>default.nix</code> file that you can\nuse to build the project in a <code>nix-shell</code>, to avoid the <code>bs-platform</code> binary issues\nin <code>node_modules</code>.</p>\n<p>e.g.</p>\n<div class="redex-codeblock"><pre class="hljs lang-none"><code>&gt; nix-shell\n%nix% &gt; npm install\n%nix% &gt; npm run start</code></pre></div>\n',homepageUrl:"https://github.com/reazen/relude",repositoryUrl:"https://github.com/reazen/relude",npmUrl:"https://www.npmjs.com/package/relude",issuesUrl:"https://github.com/reazen/relude/issues",slug:"/package/relude"}},pathContext:{id:"relude"}}}});
//# sourceMappingURL=path---package-relude-bfef51a8997b390f9d7f.js.map